        private readonly string SampleOutput;

        public static string ExampleUri {
            get {
                return "https://www.youtube.com/watch?v=hW9tIK5pcl8";
            }
        }
        
        public MockForGetMediaInformationWithYoutubeTest(string VideoTitle, string VideoID, string UploaderID, string Description, int Likes, int Dislikes, int Views, double Duration, string VideoUri, string IdentifiedArtist, string IdentifiedSong, string UploadDate) {
            Dictionary<string, string> markers = new Dictionary<string, string>() {
                ["TITLE"] = VideoTitle,
                ["VIDEOID"] = VideoID,
                ["UPLOADER"] = UploaderID,
                ["UPLOADDATE"] = UploadDate,
                ["TRACK"] = IdentifiedSong,
                ["ARTIST"] = IdentifiedArtist,
                ["LIKES"] = Likes.ToString(),
                ["DISLIKES"] = Dislikes.ToString(),
                ["VIEWS"] = Views.ToString(),
                ["DURATION"] = Duration.ToString(CultureInfo.InvariantCulture),
                ["URI"] = VideoUri,
                ["DESCRIPTION"] = Description
            };

            this.SampleOutput = SampleUnformattedOutput;

            foreach (var item in markers) {
                this.SampleOutput = SampleOutput.Replace($"%{item.Key}%", item.Value);
            }
        }

        protected override bool CheckCmdLineArgs(IEnumerable<string> args) {
            return args.Count() == 2 && args.First() == "--dump-json" && args.Last() == ExampleUri;
        }

        protected override int Main(string[] args) {
            WriteLine(SampleOutput);
            return 0;
        }
